import AnimateButton from "../Components/AnimateButton";
import { useState } from "react";


const fakemenu = [
	{title:"義大利麵", image:"./1.jpg", type:"主食"}

]



const Menu = () =>{

	const [dishType, setDishType] = useState("")


	const onClick_dishType = (e, type) => {
		console.log("we")
		console.log(type)
	}

	return (
		<>
		{
		dishType === ""
		?
		fakemenu.map(
			dish=><div onClick={e => onClick_dishType(e, dish.type)}><AnimateButton imageUrl={dish.image} imageTitle={dish.title} imageWidth={"30%"}></AnimateButton></div>) 
		:
		<p>nothing</p>
		}

		</>
	)	
}

export default Menu;
